import React from 'react'
import styled from 'styled-components'

const CardContainer = styled.div`
    display: flex;
    flex-direction: column-reverse;
    height: 100px;
    width: 100px;

`;


const TemCard = ({name, image}) => {
    return (
    <CardContainer>
        <h3></h3>
    </CardContainer>
    )
}

export default TemCard
